import React from 'react';
import {
    Navbar,
    Container,
    Nav,
    NavItem,
    ManuItem
 } from 'react-bootstrap';
 import './NavBar.css';


class NavBar extends React.Component {
    render() {
        return (
            <Navbar className="nav" expand="lg" fixed="top">
                <Container fluid="mg">
                    <Navbar.Brand className="logo"><img alt="DialexaBVG" src="../assets/DialexaBVGMainLogo.png"></img></Navbar.Brand>
                        <Nav className="pages">
                            <Nav.Link className="link">Play</Nav.Link>
                            <Nav.Link className="link">Leaderboard</Nav.Link>
                            <Nav.Link className="link">Explore</Nav.Link>
                            <Nav.Link className="link">About</Nav.Link>
                        </Nav>
                        <Navbar.Text className="name">
                            Welcome back, John!
                        </Navbar.Text>
                </Container>
            </Navbar>
        );
    }
}

export default NavBar;
